with mb_string as (

    select '' as string

),

gb_dataset as (

    select
        row_num,
        {% for i in range(1, 21) %}
        column_{{ i }}
        {% if not loop.last %}
        ,
        {% endif %}
        {% endfor %}
    from {{ ref('stg_dummy__gigabyte_dataset') }}

),

experiment_dataset as (

    select gb.*, mb.string
    from gb_dataset as gb, mb_string as mb
    where gb.row_num <= 100

)

select * from experiment_dataset
